import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCog, faSignOutAlt, faCalendar, faHome, faGripHorizontal, faUserPlus, faUsers } from '@fortawesome/free-solid-svg-icons';import "./sidebar.css"
import { Button } from 'react-bootstrap';
import { useHistory } from 'react-router-dom';
 
const Sidebar = () => {
    const addDoctor = useHistory();
const handleAddDoctor =()=>{
  addDoctor.push('/addDoctor')
}
    return (
        <div>
         <FontAwesomeIcon icon={faHome} />  <Button onClick={handleAddDoctor} style={{backgroundColor:"none"}}>Add doctor</Button> <br/><br/>
        <FontAwesomeIcon icon={faCalendar} /> <Button>Appointment</Button><br/><br/>
        <FontAwesomeIcon icon={faCog} /> <Button>Dashboard</Button>
        </div>
    );
};

export default Sidebar;
